import React from 'react'
import Button from '@material-ui/core/Button';
import corporates from '../assets/corporates.png';

function Learncontent(client) {
    var corporates = "Growlah offers an enriching opportunity for corporate engagement and bonding activities through the use of urban hydroponics or aeroponics which can be catered to outdoor roof gardens or indoor units as well. GrowLah promises a refreshing take on bonding offering a rewarding program for contribution to sustainability at the workplace.";
    return (
        <div className="learn-content">
            <img src={client} />

        </div>

    );
}
function Learn() {
    return (
        <div className="learn-container">
            <h2>Learn more</h2>
            <div className="button-container">
                <Button color="primary" className="learn-button" variant="contained">For schools</Button>
                <Button color="primary" className="learn-button" variant="contained" >For corporates</Button>
                <Button color="primary" className="learn-button" variant="contained" >For communities</Button>
            </div>
            <Learncontent />
        </div>
    )
}

export default Learn
